  \"2013-03-16T00:54:34.198962\",\n\t\"name\": \"iowa-borehole-lithology-intervals\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains borehole lithology
  data associated with a geothermal temperature depth survey.  Each interval feature
  has a top (without a bottom), measured from the ground surface (convention for interoperability)
  and a geologic unit description that will be identical with the content associated
  with polygons on a geologic map.  Other sheets in the workbook provide additional
  explanatory material and provide information on the origin of the dataset, its review
  and lineage, and a data terms sheet providing terms used in the data.  15,222 borehole
  intervals with lithology are represented in this dataset for the State of Iowa,
  provided by the Iowa Geological and Water Survey.\",\n\t\"license_title\": null,\n\t\"extras\":
